import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Landing from './Pages/Landing/Landing';
import SignIn from './Pages/Auth/SignUp';
import Payment from './Pages/Payment/Payment'; // Capitalized to match convention
import Orders from './Pages/Orders/Orders'; // Capitalized to match convention
import Cart from './Pages/Cart/Cart';
import Results from './Pages/Results/Results';

function Routing() {
  return (
    <Router>
      <Routes>
        <Route path='/' element={<Landing />} />
        <Route path='/auth' element={<SignIn />} />
        <Route path='/payments' element={<Payment />} />
        <Route path='/orders' element={<Orders />} />
        <Route path='/catagory/:catagoryName' element={<Results/>} />
        <Route path='/cart' element={<Cart />} />
      </Routes>
    </Router>
  );
}

export default Routing; // Export the Routing component, not Router
